const initialState = {
    videos: [],
    search: true,
    selectedVideo: {},
    inputtedQuestions: []
};

const questionReducer = (state = initialState, action) => {
    switch (action.type) {
        case "INPUT_QUESTION":
            state = {
                ...state,
                name: action.payload
            };
        default:
    }
    return state;
};

export default questionReducer;
